import HeaderHome from "../components2/header";
import MainHome from "../components2/main";
import ArticleHome from "../components2/article";
import Section1Home from "../components2/section1";
import Section2Home from "../components2/section2";
import Section3Home from "../components2/section3";
import FooterHome from "../components2/footer";

import Link from "next/link";
const Home = () => {
  return (
    <>
      <header>
        <div className="container">
          <div className="head-home">
            <h1> the autisum platform</h1>
            <div>
              <ul>
                <li>
                  <Link href="/">
                    <a>الرئيسية</a>
                  </Link>
                </li>
                <li>
                  <Link href="home">
                    <a>المركز الوطني</a>
                  </Link>
                </li>
                <li>
                  <Link href="centers">
                    <a>المراكز</a>
                  </Link>
                </li>
              </ul>
            </div>
          </div>
        </div>
      </header>
      <HeaderHome />
      <MainHome />
      <ArticleHome />
      <Section1Home />
      <Section2Home />
      <Section3Home />
      <FooterHome />
    </>
  );
};
export default Home;
